import { Link } from "react-router-dom";
import TopicDetails from "./TopicDetails";

function Topic() {
  const id = 5
  return (
  <div>
    <Link to={`topic${id}`}>click</Link>
      <TopicDetails />
  </div>
)

}

export default Topic;
